INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 40, "ペコリーヌとの出会い", 5118061, 91002, 2834, 1, 10118, "フリーマーケット会場", 0, 0, "青空の下で謁見", 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 40, "マホとの出会い", 5118062, 91002, 2835, 1, 10118, "フリーマーケット会場", 0, 0, "未来の騎空団\nマスコット？", 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 40, "アキノとの出会い", 5118063, 91002, 2837, 1, 10118, "ランドソル市街地", 0, 0, "お嬢さまからの\n緊急依頼", 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 40, "ジュンとの出会い", 5118064, 91002, 4108402, 1, 10118, "フリーマーケット会場", 0, 0, "黄金色の悩みごと", 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 40, "カオリとの出会い", 5118065, 91002, 4107402, 1, 10118, "フリーマーケット会場", 0, 0, "白熱！　格闘大会！", 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 40, "ニノンとの出会い", 5118066, 91002, 9000227, 1, 10118, "オーエド町", 1, 0, "祭り太鼓はオーエドの華", 2);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 40, "スズナとの出会い", 5118067, 91002, 2101181, 1, 10118, "フリーマーケット会場", 0, 0, "人気者は遅れて\nやってくる", 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 40, "ナナカとの出会い", 5118068, 91002, 4109402, 1, 10118, "ランドソル市街地", 0, 0, "巫女・ミーツ・魔法少女", 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 40, "キャル＆コッコロとの出会い", 5118069, 91002, 4305402, 1, 10118, "フリーマーケット会場", 0, 0, "ネズ耳は二度なくなる", 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 40, "ユカリとの出会い", 5118070, 91002, 4101402, 1, 10118, "ランドソル市街地", 0, 0, "この出会いにカンパイ！", 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 40, "アオイとの出会い", 5118071, 91002, 4106402, 1, 10118, "ランドソル市街地", 0, 0, "陰陽アンサンブル", 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (8, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 40, "シノブとの出会い", 5118072, 91002, 2836, 1, 10118, "フリーマーケット会場", 1, 0, "運試し十番勝負！", 3);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, 0, 0, 0, "オープニング", 5118600, 0, 0, 0, 10118, 0, 0, 10145115, "彼女たちの新たな日常", 1);
